import styled from "styled-components"
import logoduck from "../../assets/duck-head.png";

export default function SelectLevelOfStoked({ id, level, setStokedLevel, stokedLevel }) {

    function waves() {
        if (id === 1) {
            return (
                <div>
                    <img src={logoduck} />
                </div>
            )
        } else if (id === 2) {
            return (
                <div>
                    <img src={logoduck} />
                    <img src={logoduck} />
                </div>
            )
        } else {
            return (
                <div>
                    <img src={logoduck} />
                    <img src={logoduck} />
                    <img src={logoduck} />
                </div>
            )
        }
    }
    const qauntityOfWaves = waves();
    return (
        <Stoked stoked={stokedLevel === id} onClick={() => { setStokedLevel(id) }}>
            <div>
                {level}
            </div>
            <div>{qauntityOfWaves}</div>
        </Stoked>
    );
}


const Stoked = styled.div`
max-width: 30%;
background: #095e79;
border-radius: 4.63636px;
font-family: 'Lexend Deca';
font-style: normal;
font-weight: 700;
line-height: 26px;
text-align: center;
color: #52B6FF;
border: ${({ stoked }) => stoked ? '3px solid #44ABF7' : 'none'};
display: flex;
flex-direction: column;
justify-content: space-evenly;
align-items: center;
margin-right: 10px;

img{
    height: 24px;
}
`
